def get_file_path(instance, filename):
    _file_name, file_extension = os.path.splitext(filename)
    _file_name_ = _file_name.replace(".", "_")
    new_file_name = _file_name_ + file_extension
    return os.path.join('media/svg_diseases_treatments', new_file_name)

def get_file_path_and_save_to_media_manually(instance, filename):
    _file_name, file_extension = os.path.splitext(filename)
    _file_name_ = _file_name.replace(".", "_")
    new_file_name = _file_name_ + file_extension
    file_path = os.path.join('media/svg_diseases_treatments', new_file_name)
    print("file path", file_path)
    # Dosyayı belirtilen yola kopyala
    shutil.copy(instance, file_path)
    return file_path

def overwrite_svgs():
    folder_path = "/home/ubuntu/Clinic/Wizard/scripts/Teeth/Teeth Chart"
    if not os.path.isdir(folder_path):
        print("Belirtilen yol bir klasör değil.")
        return

    for filename in os.listdir(folder_path):
        if filename.endswith('.svg'):
            teeth_number = int(filename.split("_")[0])
            path = os.path.join(settings.MEDIA_ROOT, get_file_path(None, filename))
            teeth_image = TeethImages.objects.create(
                teeth_number=teeth_number,
                path=path
            )
            # SVG dosyasını doğru yola kaydetmek için
            with open(os.path.join(folder_path, filename), 'rb') as f:
                teeth_image.path.save(filename, f)

# OVERWRITE END #
                
