#from Wizard.scripts.import_teeth_svgs import get_svg_files 
def get_svg_files():
    folder_path = "/home/ubuntu/Clinic/Wizard/scripts/Teeth"
    if not os.path.isdir(folder_path):
        print("Belirtilen yol bir klasör değil.")
    else:
        # Belirtilen klasördeki tüm dosya ve klasörleri alın
        for root, dirs, files in os.walk(folder_path):
            for subfolder in dirs:
                # Alt klasörlerin içinde dön
                subfolder_path = os.path.join(root, subfolder)
                print("Alt klasör:", subfolder)
                if not subfolder == "Teeth":
                    print("59 IF ENTERED")
                    for filename in tqdm(os.listdir(subfolder_path), desc="Dosyalar işleniyor", unit="dosya"):
                        if filename.endswith('.svg'):
                            print("   Dosya:", filename)
                            file_name = filename.split('_')
                            path = os.path.join(settings.MEDIA_ROOT, get_file_path(None, filename))
                            print("path",path)
                            disease_name = ' '.join(file_name[1:]).split(".")[0]
                            print("disease_name",disease_name)
                            tooth_number = int(filename.split('_')[0])
                            print("tooth_number",tooth_number)
                            object = TeethImages.objects.get(teeth_number = tooth_number)
                            dictionary = object.svg_paths_dict
                            if dictionary:
                                dictionary = json.loads(dictionary)
                            else:
                                dictionary = {}
                            dictionary[disease_name] = path
                            object.svg_paths_dict = json.dumps(dictionary)
                            object.save()
                            path = "/home/ubuntu/Clinic/media/svg_diseases_treatments"
                            shutil.copy(os.path.join(subfolder_path, filename), path)
# SAVE END#
                            
#CHANGE ILLNESS NAME IN DICTS#
#from Wizard.scripts.import_teeth_svgs import change_illness_name 
def change_illness_name():
    objects = TeethImages.objects.all()
    disease_name_to_be_changed = "Root Treated"
    new_disease_name = "Root-Canal Filling"
    for obj in objects:
        data = json.loads(obj.svg_paths_dict)
        if disease_name_to_be_changed in data:
            data[new_disease_name] = data.pop(disease_name_to_be_changed)
            obj.svg_paths_dict = json.dumps(data)
            obj.save()
            # print("data",data)

